int main(void)
{
    seedRandom(); // randomize answers based on time
    while (1)
    {
        volatile int *pixel_ctrl_ptr = (int *)PIXEL_BUFFER_BASE;
        /* set front pixel buffer to Buffer 1 */
        *(pixel_ctrl_ptr + 1) = (int)&Buffer1; // first store the address in the  back buffer
        /* now, swap the front/back buffers, to set the front buffer location */
        wait_for_vsync();
        /* initialize a pointer to the pixel buffer, used by drawing functions */
        pixel_buffer_start = *pixel_ctrl_ptr;
        clearScreen(); // pixel_buffer_start points to the pixel buffer

        /* set back pixel buffer to Buffer 2 */
        *(pixel_ctrl_ptr + 1) = (int)&Buffer2;
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
        clearScreen();                              // pixel_buffer_start points to the pixel buffer
        clearCharacterBuffer();

        /*
        WAIT FOR USER INPUT TO PROCEED
        */
        while (!(keyboard_keys.key == KEY_SPACE && keyboard_keys.last_last_key == KEY_NULL))
        {
            pollKeyboard();
            wait_for_vsync();
            drawStartScreen(pixel_ctrl_ptr);
            clearScreen();
        }
        // wait for album select
        while (!album_select)
        {
            pollKeyboard();
            wait_for_vsync();
            drawAlbumSelect(pixel_ctrl_ptr);
            clearScreen();
        }
        clearScreen();
        wait_for_vsync();
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
        gameStart = true;
        clearScreen();
        wait_for_vsync();
        clearCharacterBuffer();
        writeRoundAndScore(0);
        loadCurrentAnswers();
        writeAnswersAndSelected();
        writeRoundDifficulty();
        while (!doneGame)
        { // while game is going on
            pollKeyboard();

            wait_for_vsync();
            pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
        }

        clearCharacterBuffer();
        updateHighScore(PlayerScore); // game ended
        while (!(keyboard_keys.key == KEY_ESC && keyboard_keys.last_last_key == KEY_NULL))
        {
            pollKeyboard();
            wait_for_vsync();
            pixel_buffer_start = *(pixel_ctrl_ptr + 1); // New back buffer
            drawEndScreen();
            displayHighScore();
        }
        reset(); // reset game variables
    }
    // done game screen
    return 0;
}

void playAudio(const int *samples, int length)
{
    // get struct for audio I/O
    audio_t *const audio = (audio_t *)AUDIO_BASE;
    int i;
    audio->control = 0x8; // clear the output FIFOs
    audio->control = 0x0; // resume input conversion
    for (i = 0; i < length; i++)
    {
        // wait till there is space in the output FIFO
        while (audio->WDRC == 0 || audio->WSLC == 0)
            ;
        audio->LEFTDATA = samples[i] /*<< 16*/;
        audio->RIGHTDATA = samples[i] /*<< 16*/;
    }
}

// seed the RNG
void seedRandom()
{
    srand(time(NULL)); // XOR time and clock to get a more random seed
}
// return random number in range inclusive
int randomInRange(int min, int max)
{
    if (min > max)
    {
        // Swap if min > max
        int temp = min;
        min = max;
        max = temp;
    }
    int result = rand() % (max - min + 1) + min;
    printf("%d", result);
    return result;
}

void loadCurrentAnswers()
{
    int indices[numSongs - 1]; // Holds potential incorrect answers
    int count = 0;

    // Fill array with all song indices EXCEPT the correct one (Round - 1)
    for (int i = 0; i < numSongs; i++)
    {
        if (i != (Round - 1)) // Skip the correct answer
            indices[count++] = i;
    }

    // Shuffle the indices using Fisher-Yates
    for (int i = count - 1; i > 0; i--)
    {
        int j = randomInRange(0, i);
        int temp = indices[i];
        indices[i] = indices[j];
        indices[j] = temp;
    }

    // Choose a random position for the correct answer (0-3)
    int correctIndex = randomInRange(0, 3);

    // Fill the answers array
    int incorrectIndex = 0;
    for (int i = 0; i < 4; i++)
    {
        if (i == correctIndex)
        {
            // Place correct answer
            strcpy(currentAnswers[i], Songs[Round - 1]);
        }
        else
        {
            // Place incorrect answers from the shuffled indices
            strcpy(currentAnswers[i], Songs[indices[incorrectIndex++]]);
        }
    }
}

void writeCharacter(char character, int x, int y)
{
    // pointer to character buffer
    volatile char *char_buffer = (char *)CHARACTER_BUFFER_BASE;

    // format word
    int offset = (y << 7) + x;

    // write word into memory
    char_buffer[offset] = character;
    return;
}

int getStringSize(char *word)
{
    int size = 0;
    while (word[size] != '\0')
    {
        size++;
    }
    // printf("'%s' is %d characters long\n", word, size);
    return size;
}

void writeWord(char *word, int x0, int y0)
{
    int size = getStringSize(word);
    // printf("writing word at %d, %d\n", x0, y0);
    for (int i = 0; i < size; i++)
    {
        writeCharacter(word[i], i + x0, y0);
    }
}

void clearCharacterBuffer()
{
    for (int x = 0; x < 80; x++)
    {
        for (int y = 0; y < 60; y++)
        {
            writeCharacter(' ', x, y);
        }
    }
}

void plotPixel(int x, int y, short int line_color)
{
    // Make sure we're within bounds
    if (x < 0 || x >= 320 || y < 0 || y >= 240)
        return;

    volatile short int *one_pixel_address;
    one_pixel_address = (volatile short int *)(pixel_buffer_start + (y << 10) + (x << 1));
    *one_pixel_address = line_color;
}

void clearScreen()
{ // loops through each pixel and sets to black
    // printf("started clearing screen\n");
    for (int x = 0; x < 320; x++)
    {
        for (int y = 0; y < 240; y++)
        {
            plotPixel(x, y, 0x0); // 0xFFFFFF
        }
    }
}

